const WelcomeBack =props=>{
    return(
        <div style={styles.container}>
            <img  width='30px' height='30px' src={require('../../images/pinterest.png')} alt="logo"/>
            <p style={styles.para}>Welcome back, PRW!</p>
            <img src={require('../../images/Screenshot at Jan 08 14-07-34.png')} alt=""/>
            <p>prwlecture@gmail.com</p>
        </div>
    )
}

export default WelcomeBack;

const styles={
    container:{
        backgroundColor:'white',
        display:'flex',
        flexDirection:'column',
        alignItems:'center',
        textAlign:'center',
        padding:'15px',
        margin:'auto',
        borderRadius:'10px'
    },
    para:{
        fontSize:'1em',
    }
}
